import "./movielist.css";
import MovieCard from "../Components/App/MovieCard/MovieCard";

function MovieList({movie}){
    return(
        <div className="MovieList">{
        movie.map( (movie)=>(
            <MovieCard movie={movie} />
        ))
        }
        </div>
    );
}

export default MovieList;
